import Table from "react-bootstrap/Table";
import { useSelector } from "react-redux";

function ImagenList() {
  //const dispatch = useDispatch()

  const data = useSelector((state) => {
    const img = state.images.data.map((imagem) => {
      // const images = state.images.data.filter(
      //   (image) => image.user_id === user.id
      // );

      // return { ...user, images };
      return { imagem };
    });

    return img;
  });

  return (
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>id</th>
          <th>Imagem</th>
          <th>Usuario</th>
        </tr>
      </thead>
      {imagem.map((item) => (
        <tbody key={item.id}>
          <tr>
            <td>{item.id}</td>
            <td>{JSON.stringify(item.url)}</td>
            <td>{item.user_id}</td>
          </tr>
        </tbody>
      ))}
    </Table>
  );
}

export default ImagenList;
